INSERT INTO `oro_email_template` (`id`, `organization_id`, `isSystem`, `isEditable`, `name`, `parent`, `subject`, `content`, `entityName`, `type`, `visible`, `user_owner_id`) VALUES
(1, 1, 1, 1, 'user_change_password', NULL, 'A new password was assigned to you', '<h1>Hello, {{ entity|oro_format_name }}!</h1>\n<p>A new password was assigned to you.</p>\n<p>Please visit <a href="{{ oro_config_value(''oro_ui.application_url'') }}{{ path(''oro_default'') }}">\n        {{ oro_config_value(''oro_ui.application_url'') }}{{ path(''oro_default'') }}</a> and use the following credentials to log in:</p>\n<p></p>\n<p><strong>Login:</strong> {{ entity.username }}</p>\n<p><strong>Password:</strong> {{ plainPassword }}</p>', 'Oro\\Bundle\\UserBundle\\Entity\\User', 'html', 1, 1),
(2, 1, 1, 1, 'user_reset_password', NULL, 'Reset password', '<h1>Hello, {{ entity|oro_format_name }}!</h1>\n\n<p>To reset your password - please visit <a href="{{ oro_config_value(''oro_ui.application_url'') }}{{ path(''oro_user_reset_reset'', { token: entity.confirmationToken }) }}">\n        {{ oro_config_value(''oro_ui.application_url'') }}{{ path(''oro_user_reset_reset'', { token: entity.confirmationToken }) }}</a></p>', 'Oro\\Bundle\\UserBundle\\Entity\\User', 'html', 1, 1),
(3, 1, 1, 1, 'user_reset_password_as_admin', NULL, 'Please reset your password', '<h1>Hello, {{ entity|oro_format_name }}!</h1>\n\n<p>This email was sent to you by administrator.</p>\n\n<p>To reset your password - please visit <a href="{{ oro_config_value(''oro_ui.application_url'') }}{{ path(''oro_user_reset_reset'', { token: entity.confirmationToken }) }}">\n        {{ oro_config_value(''oro_ui.application_url'') }}{{ path(''oro_user_reset_reset'', { token: entity.confirmationToken }) }}</a></p>', 'Oro\\Bundle\\UserBundle\\Entity\\User', 'html', 1, 1),
(4, 1, 1, 1, 'calendar_reminder', NULL, '{{ entity.title }} is starting at {{ entity.start|date(''F j, Y, g:i A'') }}', '<h1>{{ entity.title }}</h1>\n<div>\n    <p>\n        <i>When:</i> {{ calendar_date_range(entity.start, entity.end, entity.allDay, ''F j, Y'', 1) }}\n    </p>\n    <p><i>Calendar:</i> {{ entity.calendar }}</p>\n    <p>{{ entity.description }}</p>\n</div>', 'Oro\\Bundle\\CalendarBundle\\Entity\\CalendarEvent', 'html', 1, 1),
(5, 1, 1, 1, 'calendar_invitation_accepted', NULL, 'Accepted: {{ entity.title }}', '<p><b>{{ entity.calendar.owner|oro_format_name|default(''N/A'') }} has accepted this invitation.</b></p>\n<h1>{{ entity.title }}</h1>\n<div>\n    <p><i>Start date:</i> {{ entity.start|date(''F j, Y, g:i A'') }}</p>\n    <p><i>End date:</i> {{ entity.end|date(''F j, Y, g:i A'') }}</p>\n    <p><i>Description:</i>{{ entity.description }}</p>\n</div>', 'Oro\\Bundle\\CalendarBundle\\Entity\\CalendarEvent', 'html', 1, 1),
(6, 1, 1, 1, 'calendar_invitation_declined', NULL, 'Declined: {{ entity.title }}', '<p><b>{{ entity.calendar.owner|oro_format_name|default(''N/A'') }} has declined this invitation.</b></p>\n<h1>{{ entity.title }}</h1>\n<div>\n    <p><i>Start date:</i> {{ entity.start|date(''F j, Y, g:i A'') }}</p>\n    <p><i>End date:</i> {{ entity.end|date(''F j, Y, g:i A'') }}</p>\n    <p><i>Description:</i>{{ entity.description }}</p>\n</div>', 'Oro\\Bundle\\CalendarBundle\\Entity\\CalendarEvent', 'html', 1, 1),
(7, 1, 1, 1, 'calendar_invitation_delete_child_event', NULL, 'Removed: {{ entity.title }}', '<p><b>{{ entity.calendar.owner|oro_format_name|default(''N/A'') }} removed {{ entity.title }} from own calendar.</b></p>\n<h1>{{ entity.title }}</h1>\n<div>\n    <p><i>Start date:</i> {{ entity.start|date(''F j, Y, g:i A'') }}</p>\n    <p><i>End date:</i> {{ entity.end|date(''F j, Y, g:i A'') }}</p>\n    <p><i>Description:</i>{{ entity.description }}</p>\n</div>', 'Oro\\Bundle\\CalendarBundle\\Entity\\CalendarEvent', 'html', 1, 1),
(8, 1, 1, 1, 'calendar_invitation_delete_parent_event', NULL, 'Canceled Event: {{ entity.title }}', '<p><b>This event has been canceled and was removed from your calendar.</b></p>\n<h1>{{ entity.title }}</h1>\n<div>\n    <p><i>Start date:</i> {{ entity.start|date(''F j, Y, g:i A'') }}</p>\n    <p><i>End date:</i> {{ entity.end|date(''F j, Y, g:i A'') }}</p>\n    <p><i>Description:</i>{{ entity.description }}</p>\n</div>', 'Oro\\Bundle\\CalendarBundle\\Entity\\CalendarEvent', 'html', 1, 1),
(9, 1, 1, 1, 'calendar_invitation_invite', NULL, 'Invitation: {{ entity.title }}', '<h1>{{ entity.title }}</h1>\n<div>\n    {{ entity.parent.calendar.owner|oro_format_name|default(''N/A'') }} has sent you an invitation to {{ entity.title }}.\n    <p><i>Start date:</i> {{ entity.start|date(''F j, Y, g:i A'') }}</p>\n    <p><i>End date:</i> {{ entity.end|date(''F j, Y, g:i A'') }}</p>\n    <p><i>Description:</i>{{ entity.description }}</p>\n    <p>Please follow this link to respond to invitation in OroCRM: <a href="{{ oro_config_value(''oro_ui.application_url'') }}{{ path(''oro_calendar_event_view'', {''id'': entity.id}) }}">respond</a></p>\n</div>', 'Oro\\Bundle\\CalendarBundle\\Entity\\CalendarEvent', 'html', 1, 1),
(10, 1, 1, 1, 'calendar_invitation_tentative', NULL, 'Tentative: {{ entity.title }}', '<p><b>{{ entity.calendar.owner|oro_format_name|default(''N/A'') }} has changed invitation state to tentative.</b></p>\n<h1>{{ entity.title }}</h1>\n<div>\n    <p><i>Start date:</i> {{ entity.start|date(''F j, Y, g:i A'') }}</p>\n    <p><i>End date:</i> {{ entity.end|date(''F j, Y, g:i A'') }}</p>\n    <p><i>Description:</i>{{ entity.description }}</p>\n</div>', 'Oro\\Bundle\\CalendarBundle\\Entity\\CalendarEvent', 'html', 1, 1),
(11, 1, 1, 1, 'calendar_invitation_uninvite', NULL, 'Removed: {{ entity.title }}', '<p><b>You have been removed from {{ entity.title }}.</b></p>\n<h1>{{ entity.title }}</h1>\n<div>\n    <p><i>Start date:</i> {{ entity.start|date(''F j, Y, g:i A'') }}</p>\n    <p><i>End date:</i> {{ entity.end|date(''F j, Y, g:i A'') }}</p>\n    <p><i>Description:</i>{{ entity.description }}</p>\n</div>', 'Oro\\Bundle\\CalendarBundle\\Entity\\CalendarEvent', 'html', 1, 1),
(12, 1, 1, 1, 'calendar_invitation_update', NULL, 'Update: {{ entity.title }}', '<p><b>{{ entity.calendar.owner|oro_format_name|default(''N/A'') }} updated the event {{ entity.title }}.</b></p>\n<h1>{{ entity.title }}</h1>\n<div>\n    <p><i>Start date:</i> {{ entity.start|date(''F j, Y, g:i A'') }}</p>\n    <p><i>End date:</i> {{ entity.end|date(''F j, Y, g:i A'') }}</p>\n    <p><i>Description:</i>{{ entity.description }}</p>\n</div>', 'Oro\\Bundle\\CalendarBundle\\Entity\\CalendarEvent', 'html', 1, 1);
