(8193, 'oro.grid.system_configuration.fields.full_screen_layout_enabled.tooltip', 'Ce paramètre détermine si les en-têtes de grille seront verrouillés pendant le défilement sur une page', 'fr_FR', 'tooltips', 1),
(8194, 'oro.email.contexts.tooltip', 'Un contexte est tout enregistrement ou groupe d''enregistrements qui ont une relation avec une relation par email. Lorsque vous ajoutez le contexte d''un enregistrement à la conversation de messagerie, il s''affichera dans la liste des activités de cet enregistrement.', 'fr_FR', 'tooltips', 1),
(8195, 'oro.email.emailtemplate.entity_name.tooltip', 'Choisissez une entité à laquelle associer ce modèle ou laissez vide si ce modèle n''est pas lié à une entité.', 'fr_FR', 'tooltips', 1),
(8196, 'oro.embeddedform.css.tooltip', 'Veuillez saisir uniquement du code CSS.', 'fr_FR', 'tooltips', 1),
(8197, 'oro.embeddedform.success_message.tooltip', 'Ce message s''affichera après la soumission du formulaire. < br />Utiliser<strong>{back_link|Back link text}</strong> cet espace afin de saisir le lien de retour au formulaire.', 'fr_FR', 'tooltips', 1),
(8198, 'oro.entity_extend.field.option_set.option.tooltip', 'Supprimer une option entraînera la suppression de cette valeur dans les enregistrements l''utilisant.', 'fr_FR', 'tooltips', 1),
(8199, 'oro.entity_extend.enum_public.tooltip', 'Les groupes d''options public peuvent être réutilisés pour d''autres entités.', 'fr_FR', 'tooltips', 1),
(8200, 'oro.entity_extend.enum_options.tooltip', 'Supprimer un élément de la liste déroulante aura pour effet de le supprimer de tous les enregistrements associés.', 'fr_FR', 'tooltips', 1),
