(8202, 'oro.entity_extend.enum_options.default.tooltip', 'Si cochée, cette option sera être sélectionnée par défaut pour les nouveaux enregistrements.', 'fr_FR', 'tooltips', 1),
(8203, 'oro.entity_extend.entity_config.search.field.items.title_field.tooltip', 'La valeur du champ sera incluse dans le titre du résultat de la recherche', 'fr_FR', 'tooltips', 1),
(8204, 'oro.entity_merge.form.strategy_tooltip', 'La méthode de « Remplacer » utilisera la valeur sélectionnée comme nouvelle valeur du champ sélectionné. La méthode « Ajouter » combinera les valeurs sélectionnées comme nouvelle valeur du champ.', 'fr_FR', 'tooltips', 1),
(8205, 'oro.entity_merge.form.master_record_tooltip', 'Les valeurs des champs de l''ensemble des enregistrements seront fusionnées avec l''enregistrement maître, puis les enregistrements seront supprimés.', 'fr_FR', 'tooltips', 1),
(8206, 'oro.entity_pagination.system_configuration.fields.enabled.tooltip', 'Permet de naviguer d''une entité à une autre directement sur une vue détaillée', 'fr_FR', 'tooltips', 1),
(8207, 'oro.entity_pagination.system_configuration.fields.limit.tooltip', 'Nombre maximal d''enregistrements affichés sur une liste d''éléments', 'fr_FR', 'tooltips', 1),
(8208, 'oro.entity_serialized_fields.field.is_serialized.tooltip', 'La sélection d''une "colonne" vous permettra d''utiliser ce champ dans des rapports, des segments, des filtres et aussi créer une relation comportant celui-ci. Cette opération requiert la mise à jour du schéma de l''application.', 'fr_FR', 'tooltips', 1),
(8209, 'oro.form.system_configuration.fields.wysiwyg_enabled.tooltip', 'Activer l''éditeur WYSIWYG pour tous les champs textes', 'fr_FR', 'tooltips', 1),
(8210, 'oro.importexport.entity_config.full.tooltip', 'Tous les champs de l''entité associée seront exportés', 'fr_FR', 'tooltips', 1),
(8211, 'oro.importexport.entity_config.header.tooltip', 'Si vide, le label sera utilisé', 'fr_FR', 'tooltips', 1),
(8212, 'oro.integration.integration.sync_priority.tooltip', 'Sélectionner la source prioritaire entre la version locale et la version distante des données dans le cas où une mise à jour ait eu lieu des deux cotés depuis la dernière synchronisation.\n', 'fr_FR', 'tooltips', 1),
(8213, 'oro.integration.integration.default_user_owner.tooltip', 'Sélectionner le propriétaire des données de l''intégration. Toutes les entités importées seront assignées à l''utilisateur sélectionné.\n', 'fr_FR', 'tooltips', 1),
(8214, 'oro.integration.integration.organization.tooltip', 'Sélectionnez l''organisation pour l''intégration.', 'fr_FR', 'tooltips', 1),
(8215, 'oro.locale.form.tooltip.languages', 'Sélectionnez les langues qui peuvent être utilisées pour la traduction des modèles d''email.', 'fr_FR', 'tooltips', 1),
(8216, 'oro.locale.form.tooltip.locale', 'La sélection des paramètres régionaux affecte la mise en forme des chiffres, adresses, noms et dates.', 'fr_FR', 'tooltips', 1),
(8217, 'oro.locale.form.tooltip.location', ' Si l''option de la mise en forme des adresses par pays est désactivée, ou si il n''y a aucune mise en forme propres au pays, alors les adresses seront formatés selon les règles du pays principal.', 'fr_FR', 'tooltips', 1),
(8218, 'oro.locale.form.tooltip.format_address_by_address_country', 'Lorsque cette option est sélectionnée, les adresses seront mises en forme selon les règles de leurs pays. Dans le cas contraire, la mise en forme de la langue principale sera appliquée.', 'fr_FR', 'tooltips', 1),
(8219, 'oro.locale.form.tooltip.language', 'Sélectionnez la langue du système dans la liste des traductions installées (voir ci-dessous).', 'fr_FR', 'tooltips', 1),
(8220, 'oro.locale.form.tooltip.timezone', 'Sélectionnez le fuseau horaire de votre position. Toutes les dates et les heures seront affichées dans le fuseau horaire spécifié.', 'fr_FR', 'tooltips', 1),
(8221, 'oro.locale.form.tooltip.currency', 'Sélectionnez la monnaie par défaut', 'fr_FR', 'tooltips', 1),
(8222, 'oro.locale.form.tooltip.quarter_start', 'Sélectionnez la date de début du premier trimestre de l''année.', 'fr_FR', 'tooltips', 1),
(8223, 'oro.locale.form.tooltip.temperature_unit', 'Sélectionnez l''unité de température. Ce paramètres seront appliqués pour la météo sur la carte.', 'fr_FR', 'tooltips', 1),
(8224, 'oro.locale.form.tooltip.wind_speed_unit', 'Sélectionnez l''unité de vitesse du vent. Ce paramètres seront appliqués pour la météo sur la carte.', 'fr_FR', 'tooltips', 1),
(8225, 'oro.sso.system_configuration.fields.google_sso_domains.tooltip', 'Liste des domaines autorisés séparés par une virgule', 'fr_FR', 'tooltips', 1),
(8226, 'oro.tracking.form.tooltip.dynamic_tracking_enabled', 'Activer le tracking en temps réel des informations.\nNote, cela peut avoir un impact sur les performances.\n', 'fr_FR', 'tooltips', 1),
(8227, 'oro.tracking.form.tooltip.log_rotate_interval', 'A quelle fréquence faire la rotation des fichiers de log.\nCette option est requise uniquement pour le tracking non dynamique.\n', 'fr_FR', 'tooltips', 1),
(8228, 'oro.tracking.form.tooltip.piwik_host', 'URL de l''analytic Piwik.\nLorsque cette option est active toutes les informations de tracking vont être passées à l''instance piwik.\n', 'fr_FR', 'tooltips', 1),
(8229, 'oro.tracking.form.tooltip.piwik_token_auth', 'Le jeton d''autorisation de l''API Piwik est utilisé pour faire des appels API et passer des les IP des clients à Piwik.\nCe token_auth doit être aussi secret que votre login ou votre mot de passe, <strong>ne le partagez pas !</strong>\n', 'fr_FR', 'tooltips', 1),
(8230, 'oro.tracking.form.tooltip.identifier', 'L''identifiant lorsque la syncrho Piwik est activée devrait être le même que le website id Piwik.', 'fr_FR', 'tooltips', 1),
(8231, 'oro.user.image.tooltip', 'L''avatar doit être au format BMP, JPEG ou PNG, et la taille du fichier doit être inférieure à %file_size%', 'fr_FR', 'tooltips', 1),
(8232, 'oro.user.invite.tooltip', 'Lorsque cette option est sélectionnée, un email d''invitation sera envoyé', 'fr_FR', 'tooltips', 1),
(8233, 'oro.user.api.tooltip_text', 'La clé de l''API pourrait être utilisée pour l''authentification dans des logiciels tiers. Veuillez ne pas utiliser votre mot de passe habituel ici.', 'fr_FR', 'tooltips', 1),
(8234, 'oro.workflow.workflowdefinition.name.tooltip', 'Le nom du workflow', 'fr_FR', 'tooltips', 1),
(8235, 'oro.workflow.workflowdefinition.related_entity.tooltip', 'L''entité associée est l''entité pour laquelle le workflow est créé. Lorsque le workflow est actif, il peut être lancé et exécuté sur les enregistrements de son entité associée.', 'fr_FR', 'tooltips', 1),
(8236, 'oro.workflow.workflowdefinition.steps_display_ordered.tooltip', 'Lorsque cette case est sélectionnée, tous les worlflows seront affichés sur la page de l''entité associée ainsi toutes les étapes de la progression pourront être vues. Dans le cas contraire, seule l''étape en cours et les dernières étapes du workflow seront affichés. <br/><strong>Remarque :</strong> Nous recommandons de ne pas cocher cette case pour les workflows non linéaire où deux ou plusieurs étapes ont la même priorité pour éviter toute confusion.', 'fr_FR', 'tooltips', 1),
(8237, 'oro.workflow.workflowdefinition.start_step.tooltip', 'Lorsqu''une étape par défaut est spécifiée, tous les enregistrements nouvellement créés de l''entité associée auront un workflow associé. De plus le workflow sera dans l''étape par défaut. Si aucune étape n''est sélectionnée, tous les nouveaux enregistrements créés n''auront aucun worlflow associé, et devront être lancé avec une des transitions de départ.', 'fr_FR', 'tooltips', 1),
(8238, 'oro.workflow.workflowdefinition.attribute.property_path.tooltip', 'Il s''agit du champ de l''entité du workflow ou de ses entités associées qui apparaîtront sur le formulaire de transition. Utilisez-les si vous voulez que l''utilisateur ajoute ou modifie des données d''entité dans la transition.', 'fr_FR', 'tooltips', 1),
(8239, 'oro.workflow.workflowdefinition.attribute.label.tooltip', 'Utilisez cette option si vous souhaitez renommer le champ de l''entité sur le formulaire de la transition. Si vous laissez ce champ vide, une valeur système sera utilisé comme libellé.', 'fr_FR', 'tooltips', 1),
(8240, 'oro.workflow.workflowdefinition.attribute.required.tooltip', 'Cochez cette case si vous voulez que l''utilisateur ajoute des informations sur ce champ de l''entité. Notez que cela s''appliquera uniquement au formulaire de transition et n''aura aucun effet sur les attributs de l''entité.', 'fr_FR', 'tooltips', 1),
(8241, 'oro.workflow.workflowdefinition.transition.name.tooltip', 'Le nom de la transition qui s''affichera sur son bouton.', 'fr_FR', 'tooltips', 1),
(8242, 'oro.workflow.workflowdefinition.transition.step_from.tooltip', 'L''étape du workflow, pour laquelle le bouton de transition doit apparaître sur la page de l''entité.', 'fr_FR', 'tooltips', 1),
(8243, 'oro.workflow.workflowdefinition.transition.step_to.tooltip', 'L''étape vers laquelle le worlflow va avancer après que la transition ait été effectuée.', 'fr_FR', 'tooltips', 1),
(8244, 'oro.workflow.workflowdefinition.transition.display_type.tooltip', 'Les attributs de transition peuvent apparaître dans une des deux formes disponibles : dans la popup, qui est un comportement de transition par défaut approprié pour la plupart des cas, ou sur une page distincte, option à utiliser avec précaution et uniquement pour les transitions avec des attributs lourds.', 'fr_FR', 'tooltips', 1),
(8245, 'oro.workflow.workflowdefinition.transition.message.tooltip', 'Si vous souhaitez afficher une popup avec un message d''avertissement à l''utilisateur avant l''exécution de la transition, mettez le texte de l''avertissement dans ce champ.', 'fr_FR', 'tooltips', 1),
(8246, 'oro.workflow.workflowdefinition.transition.icon.tooltip', 'Une icône va apparaître sur le bouton de transition avant le nom de la transition.', 'fr_FR', 'tooltips', 1),
(8247, 'oro.workflow.workflowdefinition.transition.button_color.tooltip', 'Cette option spécifie le style visuel du bouton de transition.', 'fr_FR', 'tooltips', 1),
(8248, 'oro.workflow.workflowdefinition.transition.button_preview.tooltip', 'Il s''agit de l''aperçu en direct du bouton de transition tel qu''il apparaîtra sur la page de l''entité.', 'fr_FR', 'tooltips', 1),
(8249, 'oro.workflow.workflowdefinition.step.name.tooltip', 'Le nom de l''étape qui s''affichera sur l''enregistrement de l''entité.', 'fr_FR', 'tooltips', 1),
(8250, 'oro.workflow.workflowdefinition.step.order.tooltip', 'Un nombre qui détermine la position de l''étape dans le workflow. Plus le nombre est élevé, plus l''étape est loin du début', 'fr_FR', 'tooltips', 1),
(8251, 'oro.workflow.workflowdefinition.step.is_final.tooltip', 'Cette option marque l''étape comme la "fin" logique ou le résultat du workflow. Il s''agit d''une propriété purement logique qui est nécessaire pour distinguer chaque étape afin de créer les graphiques de l''entonnoir ou de créer des rapports sur les données du workflow. Marquer l''étape comme finale n''a aucun effet sur le flux lui-même.', 'fr_FR', 'tooltips', 1),
